import { NgModule } from '@angular/core';
import { BrowserModule } from '@angular/platform-browser';
import { ReactiveFormsModule } from '@angular/forms';
import { AppRoutingModule } from './app-routing.module';
import { AppComponent } from './app.component';
import { StudentRegistrationComponent } from './students/student-registration/student-registration.component';
import { StudentAttendenceComponent } from './students/student-attendence/student-attendence.component';
import { TeacherRegistrationComponent } from './Teachers/teacher-registration/teacher-registration.component';
import { TeacherAttendencComponent } from './Teachers/teacher-attendenc/teacher-attendenc.component';
import { LoginComponent } from './shared/login/login.component';
import { SignUpComponent } from './shared/sign-up/sign-up.component';
import { CustomDirective } from './directive/custom.directive';
import { CustomPipe } from './pipies/custom.pipe';



@NgModule({
  declarations: [
    AppComponent,
    StudentRegistrationComponent,
    StudentAttendenceComponent,
    TeacherRegistrationComponent,
    TeacherAttendencComponent,
    LoginComponent,
    SignUpComponent,
    CustomDirective,
    CustomPipe
  ],
  imports: [
    BrowserModule,
    AppRoutingModule,
    ReactiveFormsModule
  ],
  providers: [],
  bootstrap: [AppComponent]
})
export class AppModule { }
